import React from 'react';
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardActions,
  Button,
  Box,
  Chip,
} from '@mui/material';
import { motion } from 'framer-motion';
import CalendarTodayIcon from '@mui/icons-material/CalendarToday';
import LocationOnIcon from '@mui/icons-material/LocationOn';

const events = [
  {
    id: 1,
    title: 'Annual Tech Symposium',
    date: 'March 15, 2025',
    location: 'Main Auditorium',
    description: 'Join us for a day of technological innovation and inspiring talks from industry leaders.',
    category: 'Technology',
  },
  {
    id: 2,
    title: 'Cultural Festival',
    date: 'April 5-7, 2025',
    location: 'College Campus',
    description: 'Three days of music, dance, art, and celebrations showcasing diverse cultural talents.',
    category: 'Cultural',
  },
  {
    id: 3,
    title: 'Career Fair 2025',
    date: 'May 20, 2025',
    location: 'Convention Center',
    description: 'Meet top employers and explore career opportunities across various industries.',
    category: 'Career',
  },
  {
    id: 4,
    title: 'Sports Tournament',
    date: 'June 10-15, 2025',
    location: 'Sports Complex',
    description: 'Annual inter-college sports competition featuring various sports and athletics events.',
    category: 'Sports',
  },
];

const Events = () => {
  return (
    <Box sx={{ py: 8 }}>
      <Container>
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <Typography variant="h2" gutterBottom align="center">
            Upcoming Events
          </Typography>
          <Typography variant="h5" paragraph align="center" color="text.secondary">
            Join Us for Exciting Events and Activities
          </Typography>
        </motion.div>

        <Grid container spacing={4} sx={{ mt: 4 }}>
          {events.map((event, index) => (
            <Grid item xs={12} md={6} key={event.id}>
              <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
              >
                <Card 
                  sx={{ 
                    height: '100%',
                    display: 'flex',
                    flexDirection: 'column',
                    '&:hover': {
                      transform: 'translateY(-8px)',
                      transition: 'transform 0.3s ease-in-out',
                    },
                  }}
                >
                  <CardContent sx={{ flexGrow: 1 }}>
                    <Box sx={{ mb: 2 }}>
                      <Chip 
                        label={event.category} 
                        color="primary" 
                        size="small" 
                      />
                    </Box>
                    <Typography gutterBottom variant="h5" component="h2">
                      {event.title}
                    </Typography>
                    <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                      <CalendarTodayIcon sx={{ mr: 1, fontSize: 'small' }} />
                      <Typography variant="body2" color="text.secondary">
                        {event.date}
                      </Typography>
                    </Box>
                    <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                      <LocationOnIcon sx={{ mr: 1, fontSize: 'small' }} />
                      <Typography variant="body2" color="text.secondary">
                        {event.location}
                      </Typography>
                    </Box>
                    <Typography paragraph>
                      {event.description}
                    </Typography>
                  </CardContent>
                  <CardActions>
                    <Button 
                      size="small" 
                      variant="contained"
                      fullWidth
                    >
                      Register Now
                    </Button>
                  </CardActions>
                </Card>
              </motion.div>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Events;
